import React, { useState } from "react";
import TodoList from "./TodoList";
import { v4 as uuidv4 } from "uuid";
import Input from "./Input";
const Main = () => {
  const [todos, setTodos] = useState([
    {
      id: 1,
      text: "할일1",
      checked: false,
    },
    {
      id: 2,
      text: "할일2",
      checked: false,
    },
    {
      id: 3,
      text: "할일3",
      checked: true,
    },
  ]);

  return (
    <div>
      <Input />
      <TodoList todos={todos} isChecked={true} />
      <TodoList todos={todos} isChecked={false} />
    </div>
  );
};

export default Main;
